  \"2016-07-27T22:18:56.860290\",\n\t\"name\": \"compatibility-determination-waterfowl-hunting-on-5500-acres-of-former-commercial-salt-pond\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Compatibility Determination concerns
  the proposed waterfowl (duck, goose, and coot) hunting program for the Alviso and
  Ravenswood Salt Ponds.  Ponds AB1, A2E, AB2, A3N, A3W, A5, A7 and A8N would be open
  to waterfowl hunting three days a week for a total of approximately 2,622 acres.
  Ponds A1, A2W, A8S, A22, A23, R3, R4, R5, SF-2 and S5 would be closed to waterfowl
  hunting for a total of approximately 2,378 acres.  The Hunting Program would be
  monitored by taking information on number of hunters and harvest information conducted
  by Refuge law enforcement staff.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
